/*
  elm-hot creates an additional div wrapper around the app to make HMR possible.
  This could break styling in development mode if you are using Elm UI.

  More context in the issue:
    https://github.com/halfzebra/create-elm-app/issues/320
*/
[data-elm-hot="true"] {
  height: inherit;
}


/***********************************************************************/
/* DEFAULT STYLING */
/***********************************************************************/

body {
  font-family: "Inter", "Helvetica", "Arial", system-ui, sans-serif;
  margin: 0;
  background: #f7f7f7;
}

/***********************************************************************/
/* JUICEBOX HTML ELEMENT STYLING */
/***********************************************************************/

div.hic-root {
  border-width: 0px;
  margin: 0;
  z-index: 0;
  position: absolute;
  top: -70px;
}

/***********************************************************************/
/* ELM STYLING */
/***********************************************************************/

#elm-splash {
  top: 0;
  left: 0;
  position: absolute;
  width: 100vw;
  height: 100vh;
  z-index: 30;
  background: white;
}

#elm-screen {
  top: 0;
  left: 640px;
  position: absolute;
  width: calc(100vw - 640px);
  height: 100vh;
  z-index: 10;
  background: white;
  box-shadow: inset 0 0 20px rgba(0, 0, 0, 0.1);
}

#elm-hic-overlay {
  top: 0;
  left: -640px;
  position: absolute;
  width: 640px;
  height: calc(800px - 70px);
  z-index: 20;
  pointer-events: none;
  background: blue;
  background: transparent;
  opacity: 1;
}

#elm-main {
  height: 100%;
  width: 100%;
  overflow: auto;
}

#elm-hic-overlay-svg {
  position: absolute;
  background: none;
  /* background: yellow; */
}

#elm-hic-overlay-buttons {
  top: calc(800px - 70px);
  left: -640px;
  position: absolute;
  width: 640px;
  height: calc(100vh - 800px + 70px);
  z-index: 20;
}

#chromosome-grid-selector-container {
  position: relative;
}
#chromosome-grid-selector {
  display: grid;
  /* width: calc(100vh - 800px + 70px); */
  /* height: calc(100vh - 800px + 70px); */
  width: 200px;
  height: 200px;
  background: #eaeaea;
  grid-template-columns: repeat(24, 1fr);
  grid-template-rows: repeat(24, 1fr);
}

#chromosome-box {
  position: relative;
  background: white;
}


#chromosome-box:hover {
  background: darkgray;
}

#chromosome-box:hover > #chromosome-box-tooltip,
#all-chromosome-box:hover > #chromosome-box-tooltip {
  display: block;
}

#chromosome-box.highlight {
  background: red;
}

#chromosome-box-tooltip {
  position: absolute;
  box-sizing: border-box;
  bottom: 10px;
  width: 80px;
  background: gray;
  color: white;
  display: none;
  pointer-events: none;
  z-index: 30;
  line-height: 1;
  font-size: 11px;
  padding: 5px;
}

#chromosome-all-button {
  position: absolute;
  top: 50px;
  left: 100px;
}

#all-chromosome-box > #chromosome-box-tooltip {
  top: 0;
  right: 0;
  width: 40px;
  height: 20px;
}

  width: 12px;

}

  flex-wrap: nowrap;
  justify-content: flex-start;
  align-items: center;
  width: 100%;
  height: 20px;
  background-color: transparent;
}
.jb-igv-menu-popup-check-container div {
  padding-top: 2px;
  padding-left: 8px;
}

  position: relative;
  width: 12px;
  height: 12px;
}
.jb-igv-menu-popup-check-container div:first-child svg {
  position: absolute;
  width: 12px;
  height: 12px;
}

.jb-igv-menu-popup-chart {
  display: flex;
  flex-flow: row;
  flex-wrap: nowrap;
  justify-content: space-evenly;
  align-items: center;
  height: 16px;
}
.jb-igv-menu-popup-chart > div {
  font-size: 0.75rem;
  font-weight: 800;
  width: 16px;
  height: 16px;
  line-height: 16px;
  color: white;
  text-align: center;
  vertical-align: middle;
}
.jb-igv-menu-popup-chart > div:nth-child(1) {

}

}

}

}
